//KALKULATOR SELECT VALUE
var License=0;
var Service=0;
var Platform=0;
var ExtraVm=0;
var ExtraGb=0;
var Space=0;
var Vm=0;
var AddSpace=0;
var AddVm=0;


$(".dropdown-menu li a").click(function(){
  var selText = $(this).text();
  $(this).parents('.dropdown').find('.dropdown-toggle').html(selText+' <span class="caret"></span>');
});

$("#license li a").click(function(){
  License = $(this).attr("value");
    calculate();
});

$("#service li a").click(function(){
  Service = $(this).attr("value");
    Space=parseInt($(this).attr("space"));
    Vm=parseInt($(this).attr("vm"));
    calculate();
});

$("#platform li a").click(function(){
  Platform = $(this).attr("value");
   calculate();
});

$("#extraVm").click(function(){
  ExtraVm = 15 * parseInt($(this).attr("value"));
    /*alert($("#spinner").attr("value"));*/
   /*calculate();*/
});

$("#spiner2").click(function(){
  ExtraGb = $(this).attr("value");
   calculate();
});

 function extraVmPlus(){
     var result =0;
     if(parseInt(document.getElementById("extraVm").value) < 30){
         result = parseInt(document.getElementById("extraVm").value) + 1;
     }
     else{
        result=30;
        AddVm=30;
     }
     
    ExtraVm = result * 15;
     AddVm =result;
    calculate();
 }

 function extraVmMinus(){
         var result =0;
     if(parseInt(document.getElementById("extraVm").value) > 0){
         result = parseInt(document.getElementById("extraVm").value) - 1;
     }
     else{
        result=0;
        AddVm=0;
     }
    ExtraVm = result * 15;
     AddVm =result;
    calculate();
 }

 function extraRamPlus(){
     var result = 0;
     if(parseInt(document.getElementById("extraRam").value) < 30){
         result = parseInt(document.getElementById("extraRam").value) + 1;
     }
     else{
        result=30;
        AddSpace=30*100;
     }
    ExtraGb = result * 10;
    AddSpace =result * 100;
    calculate();
 }

 function extraRamMinus(){
         var result =0;
     if(parseInt(document.getElementById("extraRam").value) > 0){
         result = parseInt(document.getElementById("extraRam").value) - 1;
     }
     else{
        result=0;
        AddSpace=0;
     }
    ExtraGb = result * 10;
    AddSpace =result * 100;
    calculate();
 }


 function calculate (){
    var result = parseInt(License) + parseInt(Service) + parseInt(Platform) + parseInt(ExtraVm) + parseInt(ExtraGb);
     document.getElementById("cijena").innerHTML = result;
     document.getElementById("vm").innerHTML = Vm + AddVm;
     document.getElementById("space").innerHTML = Space + AddSpace; 
     
 }





